import React from 'react'
import { connect } from 'react-redux'

const Dashboard  = ({auth}) => {

    return(
        <div>
        <h1>DashBoard</h1>
        <h2>{ auth.username }</h2>
        </div>
    )
}

const mapStateToProps = state => ({
    auth: state.auth
})

export default connect(mapStateToProps)(Dashboard);
